import{_ as o,c as e,o as n,ah as i}from"./chunks/framework.PvdZnrZd.js";const u=JSON.parse('{"title":"SHIPMONDO SHIPPING","description":"SHIPMONDO SHIPPING","frontmatter":{"title":"SHIPMONDO SHIPPING","description":"SHIPMONDO SHIPPING","date":"2025-07-18T00:00:00.000Z","author":"Chirag Tyagi"},"headers":[],"relativePath":"zenith/featured-app/shipping/shipmondo.md","filePath":"zenith/featured-app/shipping/shipmondo.md"}'),r={name:"zenith/featured-app/shipping/shipmondo.md"};function l(a,t,s,p,g,h){return n(),e("div",null,[...t[0]||(t[0]=[i('<p><a href="https://webkul.com/blog/shopify-multivendor-marketplace-new-theme-launched/" target="_blank" rel="noreferrer">Multi-Vendor Marketplace for Shopify</a> is here with another marketplace shipping feature add-on, i.e., <strong>Shipmondo</strong>.</p><p><strong><a href="https://shipmondo.com/" target="_blank" rel="noreferrer">Shipmondo</a></strong>: They help you ship goods worldwide across carriers from one platform.</p><p>Making it possible for you to offer different shipping options to your customers. Note that currently, we only support Postnord Shipping within Shipmondo.</p><p>Using this featured app, merchants can allow vendors to ship their goods via multiple carrier shipping methods and then print the shipping label.</p><p><strong>Charges:</strong> This feature will have an additional charge of <strong>USD 10 per month</strong> over &amp; above your current multivendor marketplace plan.</p><p><strong>Before You Install</strong>: It is mandatory to have <strong><a href="https://help.shopify.com/en/manual/shipping/setting-up-and-managing-your-shipping/enabling-shipping-carriers" target="_blank" rel="noreferrer">real-time carrier calculated shipping</a></strong> within your Shopify store.</p><p>This is a requirement defined by Shopify for your store to retrieve shipping rates from third-party sources, such as this shipping app.</p><p>This feature app is available only with the Multivendor <strong>Pro</strong> <strong>Plan</strong> ($60/month). Moreover, you need to enable the <a href="https://webkul.com/blog/shopify-multivendor-marketplace-shipping/" target="_blank" rel="noreferrer"><strong>Shipping</strong></a> add-on (free) from the ‘featured apps’ section of the app.</p><h3 id="installation" tabindex="-1">Installation <a class="header-anchor" href="#installation" aria-label="Permalink to &quot;Installation&quot;">​</a></h3><p>Enable the following app by visiting:</p><ul><li>Multi-Vendor <strong>Admin Panel</strong></li><li>From the Dashboard, hover over the <strong>three dots</strong> on the top-right of the page</li><li>Click on <strong>Feature Apps</strong></li><li>Search for ‘<strong>Shipmondo</strong>‘ &amp; click on ‘<strong>Enable</strong>‘</li><li>After accepting the charges, you’ll be good to configure the app!</li></ul><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2020/09/Feature-Apps-Admin-1200x597.png" alt="Feature-Apps-Admin"></p><h3 id="configuration-admin-end" tabindex="-1">Configuration: Admin End <a class="header-anchor" href="#configuration-admin-end" aria-label="Permalink to &quot;Configuration: Admin End&quot;">​</a></h3><p>Firstly, the admin needs to enable this shipping method from the shipping configuration. So, for this, visit:</p><p><strong>Multivendor Marketplace Admin Panel</strong> &gt; <strong>Configuration</strong> &gt; <strong>Shipping Configuration</strong>.</p><p>Click on the <strong>three dots</strong> under the <strong>Action</strong> menu &amp; further, click on <strong>enable</strong>.</p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2020/09/Configuration-Admin-1200x560.png" alt="Configuration-Admin"></p><p>Moving on, the admin needs to configure the Shipmondo. So, for this, click on <strong>Configure Shipping</strong> as shown in the image above,</p><p>or visit <strong>Multivendor Marketplace Admin Panel</strong> &gt; <strong>Configuration</strong> &gt; <strong>Shipmondo Configuration</strong>. Refer:</p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2020/09/Shipmondo-Configuration-Admin-1-2-1200x597.png" alt="Shipmondo-Configuration-Admin-1-2"></p><h3 id="shipmondo-configuration" tabindex="-1">Shipmondo Configuration <a class="header-anchor" href="#shipmondo-configuration" aria-label="Permalink to &quot;Shipmondo Configuration&quot;">​</a></h3><p>On the following page, configure the following details:</p><ul><li>Shipmondo API Username</li><li>Shipmonde API Key</li><li>Choose shipping service that you want to allow for shipping: <ul><li>MyPack Home</li><li>MyPack Collect<br> With this, you can also configure the frontend labels.</li></ul></li><li><strong>Sandbox Mode</strong>: If you want to test the functionality of this shipping method, keep the sandbox mode enabled. Remember, shipping labels won’t be generated in testing mode.</li></ul><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2020/10/Shipmondo-Configuration-Admin-1200x948.png" alt="Shipmondo-Configuration-Admin"></p><ul><li><strong>Automatic shipping label generation</strong>: By enabling this, the shipping label will be automatically generated at the tie of order fulfillment.</li><li><strong>Automatic Fulfilment</strong>: By enabling this configuration, the order will be fulfilled automatically.</li><li><strong>Shipping label cost is borne by</strong>: Choose who will bear the shipping label charges, the admin, or the seller. (This is an extra cost apart from what the customer has paid.)</li><li><strong>Customer Cut-off amount</strong>: Enter the amount below which if an order is placed then we&#39;ll deduct a fixed amount for the shipping from the customer. Use 0 to disable this option.</li><li>If the seller is bearing the shipping charges, the admin needs to fill in the following details: <ul><li><strong>Cut off amount</strong>: If the order amount for the particular seller gets over this value then admin can deduct a fixed amount for the label from seller earnings.</li><li><strong>Amount deduct for the label</strong>: The amount to be deducted from the seller earning when the cut-off amount is reached.</li></ul></li><li>Select country</li><li>Select the shipping method</li></ul><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2020/10/Shipmondo-Configuration-Admin-2-1200x789.png" alt="Shipmondo-Configuration-Admin-2"></p><h3 id="set-shipping-method-for-sellers" tabindex="-1">Set Shipping Method For Sellers <a class="header-anchor" href="#set-shipping-method-for-sellers" aria-label="Permalink to &quot;Set Shipping Method For Sellers&quot;">​</a></h3><p>The admin can further set the shipping methods for his sellers. Go to <strong>Multi vendor marketplace admin panel</strong> &gt; <strong>Sellers</strong> &gt; <strong>Seller Listing</strong> &gt; <strong>Edit</strong> (under <strong>Action</strong>).</p><p>On the edit seller page, the admin will have the following block from where he can enable/disable/set as default:</p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2020/09/Edit-Seller-Admin-1200x597.png" alt="Edit-Seller-Admin"></p><p>Further, the admin can view all the sellers which are using this shipping method by going to <strong>Multi vendor marketplace admin panel</strong> &gt; <strong>Configuration</strong> &gt; <strong>Shipping</strong> <strong>Configuration</strong>:</p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2020/09/Configuration-Admin-1-1200x597.png" alt="Configuration-Admin-1"></p><p>The redirected page:</p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2020/09/Shipping-Admin-1200x821.png" alt="Shipping-Admin"></p><p>Here, clicking on the ‘Edit’ button for a particular seller will redirect you to the ‘Edit Seller’ page</p><p>from where you can disable the following shipping method for that seller (as shown previously in this blog).</p><h3 id="make-shipping-address-phone-number-mandatory" tabindex="-1">Make <strong>Shipping</strong> <strong>Address Phone Number</strong> Mandatory <a class="header-anchor" href="#make-shipping-address-phone-number-mandatory" aria-label="Permalink to &quot;Make **Shipping** **Address Phone Number** Mandatory&quot;">​</a></h3><p>To use this feature add-on, the admin needs to make the <strong>shipping</strong> <strong>address phone number mandatory</strong> at the time of <strong>checkout</strong>.</p><p>So, to do this, go to <strong>Shopify Backend</strong> &gt; <strong>Settings</strong> &gt; <strong>Checkout</strong> &gt; Under <strong>Form Options</strong>, make <strong>Shipping</strong> <strong>address phone number</strong> as <strong>Required</strong>:</p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2019/09/demo-store-Checkout-Shopify-1200x597.png" alt="133"></p><h3 id="configuration-seller-end" tabindex="-1">Configuration: Seller End <a class="header-anchor" href="#configuration-seller-end" aria-label="Permalink to &quot;Configuration: Seller End&quot;">​</a></h3><p>Further, the seller can configuration Shipmondo from his panel.</p><p>Go to <strong>Multi-Vendor Marketplace Seller Panel</strong> &gt; <strong>Configuration</strong> &gt; <strong>Shipping Configuration</strong>&gt; <strong>Enable</strong>/<strong>Disable</strong> the shipping:</p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2020/09/Shipping-Configuration-Seller-%E2%80%A2-Multivendor-MarketPlace-1200x597.png" alt="Shipping-Configuration-Seller-•-Multivendor-MarketPlace"></p><p>Furthermore, the seller can set the shipping method as <strong>by-default</strong> so that every single product created by him will have <strong>Shipmondo</strong> as the <strong>by-default shipping method</strong>.</p><p>Clicking on ‘<strong>Set As Default</strong>‘ will give you the following dialogue box:</p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2020/09/Shipping-Configuration-Seller-%E2%80%A2-Multivendor-MarketPlace-1-1200x597.png" alt="Shipping-Configuration-Seller-•-Multivendor-MarketPlace-1"></p><p>Set Default Shipping Method For Products:</p><ul><li>For all products (old and new)</li><li>Only for new products</li><li>For products that don’t have any shipping method on</li></ul><p>If not this, the seller can set the shipping method on individual products while adding/editing them.</p><p>So, go to <strong>Multi-vendor marketplace seller panel</strong> &gt; <strong>Products</strong> &gt;<strong>Product Listing</strong> &gt; <strong>Add</strong>/<strong>Edit</strong> the Product:</p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2020/09/Edit-Product-Seller-%E2%80%A2-Multivendor-MarketPlace-1200x597.png" alt="Edit-Product-Seller-•-Multivendor-MarketPlace"></p><h3 id="global-configuration" tabindex="-1"><strong>Global Configuration</strong> <a class="header-anchor" href="#global-configuration" aria-label="Permalink to &quot;**Global Configuration**&quot;">​</a></h3><p>Further, click on the <strong>Global Configuration</strong> menu on the <strong>Shipping Configuration</strong> page. From here, the seller can do the <strong>SHIPPING PACKET CONFIGURATION</strong>:</p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2020/09/Shipping-Configuration-Seller-%E2%80%A2-Multivendor-MarketPlace-2-1200x597.png" alt="Shipping-Configuration-Seller-•-Multivendor-MarketPlace-2"></p><h3 id="shopify-store-frontend" tabindex="-1">Shopify Store Frontend <a class="header-anchor" href="#shopify-store-frontend" aria-label="Permalink to &quot;Shopify Store Frontend&quot;">​</a></h3><p>The customer will have an option to select the shipping method as per configured from the backend after entering the information:</p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2020/09/Shipping-abhishek-store2-Checkout-1200x597.png" alt="Shipping-abhishek-store2-Checkout"></p><h3 id="shipping-label-generation" tabindex="-1">Shipping Label Generation <a class="header-anchor" href="#shipping-label-generation" aria-label="Permalink to &quot;Shipping Label Generation&quot;">​</a></h3><p>If the order fulfillment is set to automatic, the seller will receive an email. The email will have a link to download the label. Demo email:</p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2020/09/Screenshot-from-2020-09-03-19-59-03-1200x461.png" alt="Screenshot-from-2020-09-03-19-59-03"></p><p>If the orders are not set to auto-fulfillment, sellers can fulfill them manually.</p><p>Seller will have an option to generate the shipping label from their seller panel. Also, shipping labels can only be generated for <strong>fulfilled orders</strong>.</p><p><strong>Fulfilling order via Shipmondo</strong>:</p><p>Go to <strong>Multi-vendor marketplace seller panel</strong> &gt; <strong>Orders</strong> &gt; <strong>Order Listing</strong> &gt; <strong>View</strong> (under <strong>Action</strong>). Select the method of order fulfillment as <strong>Shipmondo</strong> and fulfill the order.</p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2020/09/Order-Details-Seller-%E2%80%A2-Multivendor-MarketPlace-1200x597.png" alt="Order-Details-Seller-•-Multivendor-MarketPlace"></p><p>Furthermore, this is how the shipping label will be downloaded in pdf form:</p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2020/09/pdk.png" alt="pdk"></p>',68)])])}const c=o(r,[["render",l]]);export{u as __pageData,c as default};
